symbols.html.body:
Symbols
A primitive data types that serves as unique identifier for object properties and Hooyah !!! its Immutable

While ES6 has introduced many features that have been on developer's wish list for quite some time there are some new features and its benefits are less well known, so why wait lets dig-in ...
Creating New Symbols
As Symbols are primitive data type, they are created via a factory function Symbol as below,

let symbol = Symbol('symbol');

Every time when the factory function is called, a new and unique symbol is created. The optional parameter is a descriptive string that is shown when printing the symbol really !!! Ya that's true it did't have no other purpose !!!

let foo = Symbol();

let bar = Symbol();

foo === bar // false

By the above code snippet, it is guaranteed that symbols are always unique The label does not affect the value of the symbol as I mentioned above, but it is useful for debugging though, and Symbol()is shown if the symbol’s toString() method is called. However it is possible to create a Symbols with same string, but that would be irrational as it serve no purpose and would probably just lead to confusion.

let symbol1 = Symbol('Hello');
let symbol2= Symbol('World');
symbol1 === symbol2 // false
console.log(symbol2) // 
Usage
well as you have gessed by now, it can be used as keys of properties which is a best fit for

To Create Non-Public Properties.

To keep Meta-level Propertied from clashing with global \/ base level properties.

To create Immutable data types.


Therefore we can create an unlimited number of unique Symbols to an Object and be guaranteed that there will be no conflict with string Keys ot other unique Symbols
Symbols as property keys
var node = {};
const LEFT = Symbol('left');
const RIGHT = Symbol('right');

// const RIGHT = new Symbol('right'); //TypeError 
...
//creating a node for double linked list
node = {LEFT: null, data: d, Right: null};

//using bracket notaion, 
node[LEFT] = null;
node[RIGHT] = null;

A method definition can also have a computed key:
const getAttr = Symbols();
const node = {
    [getAttr]() {
        return 'Hello getAttr;'
    }
}

console.log(node[getAttr]()); // 
Given the fact that the Symbols can be used as property keys, it has re-defined the terminology as Property Keys are either strings or Symbols in ES6 hence symbol-valued property keys are called property symbols
const node = {
    [Symbol('enumSample')] : null,
    data: {},
    sampleTxt: "Hi There !!! "
}

//Ignores symbol-valued property keys
 Object.getOwnPropertyNames(node) // 
The Global Registry
The Es6 specification defines a runtime-wide symbol registry, which enables one can store and retrieve symbols across different contexts, such as between a document and an embedded iframe or service worker.
When the Global Registry is defnied it would have the fallowing data-structure

[[Keys]] - Array of Keys used to define Symbols
[[Symbols]] - Array of Symbols registered globally 

Symbol.for(key)
In contrast of Symbol(), the .for(key) function searches for existing symbols in a runtime-wide symbol registry [[Symbols]] with the given key and returns it if found. Otherwise a new symbol is created in the global symbol registry with this key.
'use strict;'

Symbol.far('node.LEFT'); // would create a new global Symbol
Symbol.far('node.LEFT'); // retieve the already available Symbol from Global registry [[Symbols]]

// Global Symbol of same string are alway equal
Symbol.far('node.LEFT') == Symbol.far('node.LEFT'); // true
// however  not the same for local context
Symbol('node.LEFT') == Symbol('node.LEFT'); // false

const stmNodeLeft = Symbol.for("node.LEFT");
symNodeLeft.toString(); //
Symbol.keyFor(key)
The .Keyfor() function retrieves a shared symbols key from the global symbol registry [[Keys]] for the given symbols
let node_left = Symbol.for("node.LEFT");
Symbol.keyFor(node_left); // 
@@iterator to make the object Iterable
Symbol.iterator probably a well-known symbol specifies the default iterator for an object. It allows to define how the object should be iterated using for...of statement or consumed by ... spread operator.
Many built-in types like strings, arrays, maps, sets are iterables, i.e. they have an  @@iterator function whose behaviour can be tamed by using Symbols
@@iterator method is called with no arguments, and the returned iterator is used to obtain the values to be iterated.
Some built-in types have a default iteration behavior, while other types (such as Object) do not. The built-in types with a @@iterator method are:

Array.prototype

TypedArray.prototype

String.prototype

Map.prototype

Set.prototype


Usage
The following example creates an iterable object of a Linked list
class linkedList {

    node(d, prev, next) {
        return {[PREV]: prev, 'data': d, [NEXT]: next};
    }

    [Symbol.iterator]() { 
        var i = 0,
         ...
         return { 
            next: () => { 
                if (i++ > 0) 
                    _nodeToReturn = (_nodeToReturn[NEXT] ? _nodeToReturn[NEXT] : null); 
                return { 
                    value: , done: 
                   }
             }
           };
     }

...

}

// returns an Iteratable object
var obj = new linkedList();

for (var o of obj) {
   length++;
}

As per the above example @@iterator property also accepts a generator function, which makes it even more valuable. The generator function returns a generator object, which conforms to iterator protocol.
If the primitive type or object has an @@iterator method, then it can be applied in the following constructs:

Iterate over the elements in for...of loop
Create an array of elements using spread operator [...iterableObject]
Create an array of elements using Array.from(iterableObject)
In yield* expression to delegate to another generator
In constructors for Map(iterableObject), WeakMap(iterableObject), Set(iterableObject), WeakSet(iterableObject)
In promise static methods Promise.all(iterableObject), Promise.race(iterableObject)

@@hasInstance to customize instanceof
By default the instanceof operator verifies if the prototype chain of an Object contains that instance, For Example:
function Constructor() {  
  // constructor code
}
let obj = new Constructor();  
let objProto = Object.getPrototypeOf(obj);  
objProto === Constructor.prototype; // => true  
obj instanceof Constructor;         // => true  
obj instanceof Object;              // => true

As per the above Ex, the obj instanceof evaluates to true as the prototype of the Object equals Constructor.prototype
Unfortunatly Often an application does not deal with prototypes and requires a more specific instance verification thus comes the Symbol.hasInstance a well-known symbol which can be used to determine if a constructor object recognizes an object as its instance. For Ex,
class MyArray { 
    static [Symbol.hasInstance](instance) { 
        return Array.isArray(instance); 
    }
}

console.log([] instanceof MyArray); // 
@@isConcatSpreadable to convert an object to flat array elements
As the name suggest it is a Boolean valued property indicating if an Object can be flattened to an Array Elements by Array.prototype.concat() function
// Array of names 
const name = ["Jhone", "Dominic", "Sam", "Venkat"];

// Array of Age corresponding to the name array
const Age = [48, 24, 40, 24];

name.concat([], Age) // 
As per the above example, by setting _isConcatSpreadable_ as false keeps the array Age intact in the concatenation result ["Jhone", "Dominic", "Sam", "Venkat", [48, 24, 40, 24]]
On the Contrary to an array, by default .concat() method does not spread the array-like objects. But it can be achievable by setting _isConcatSpreadable_ as true

// Array like Objects representing list of  names 

const name = {0: "Jhone", 1: "Dominic", 2: "Sam", 3: "Venkat", length: 4};

// Array of Age corresponding to the name array

const Age = [48, 24, 40, 24];

name.concat([], Age) // 
@@unscopables for properties accessibility within with
In ES5 the use @@unscopables is for Arrays only meaning it can be used to hide the new methods that may override variables with the same name in older JS code. Thus Symbol.unscopables is an object valued property whose own property names are property names that can be excluded from the with environment bindings of the associated object.
Array.prototype[Symbol.unscopables]; 
// 
The method .entries() is listed in the @@unscopables property with true, thus it is not available within with block.
@@unscopables exists mostly for backward compatibility with older JS code that utilizes with block.
@@toPrimitive to convert an object to a primitive type
Specifies a function valued property, when called upon converts an object to a corresponding primitive value.
function _toPrimitive(hint) { 
    if (hint === 'number') { 
        return this.reduce((sum, num) => sum + num); 
    }
    else if (hint === 'string') {
        return `[${this.join(', ')}]`;
    }
    else {         
        // hint is default 
        return this.toString(); 
    }
}
let Age = [10, 25, 30]; 
Age[Symbol.toPrimitive] = _toPrimitive; 

// array to number. hint is 'number'
+ Age; // => 9 

// array to string. hint is 'string' 
Age is ${array}`; // => 'Age is [10, 25, 30]'

// array to default. hint is 'default' 
'Age elements: ' + array; // => 'array elements: 10, 25, 30'

As per above example _toPrimitive is function that Array to a primitive data type depending on hint The assignment Array[Symbol.toPrimitive] = _toPrimitive makes the array to use the new conversion method.
Thus @@toPrimitive method is used when an object interacts with a primitive type:

In equality operator object == primitive
In addition\/concatenation operator object + primitive
In subtraction operator object - primitive
Different situations when an object is coerced to a primitive: String(object), Number(object), etc.

@@toStringTag to create the default description of an object
To create a default string description of an object to describe object type tag. It is used by the method Object.prototype.toString() by default
When using toString()
class linkedList {}

Object.prototype.toString.call(new linkedList()); // "[object Object]"

Now, with the help of toStringTag()
class linkedList {
    get [Symbol.toStringTag]() {
        return "linkedList";
    }
}

Object.prototype.toString.call(new linkedList()); // "[object linkedList]"

Pros and Cons
so far we went throught till now, what symbols are, what symbols are't and how they work ? but it's importan to know it Pro's and Cons out of it

Will never conflict with Object string keys
They are Not Private as all of the Symbols of an object can be derived by using Object.getOwnSymbols()
Symbols are not coercible into primitives.
Symbols are not always unique due to Symbol.far() global registry
Cant be read using exsiting Reflection tool set, need to use Object.getOwnPopertySymbols() to access an Object’s symbols

Conclusion
As we have seen so far, the Well-know symbols are properties that allow us to hack into some of JavaScript default functionalities, Thus making candidate for MP in JS.
By using Symbols we adpot the nature of extensibility and redemption from polluting Object porperties

proxies.html.body:
Proxies
Proxies allow us to re-define JS in a way that is never possible before.

Proxies are lower level functionality introduced as a part of ES6, By that They alter the default behavior of Javascript by a wrapper function called Traps aka Proxy handlers. These handlers have an opportunity to perform extra logic on top of native function before forwarding to the original target/wrapped object.
Again as I described above, Proxies a bility to modify the default behavior of Javascript within itself is one of the ingredients that amuses me toward Javascript.
Let's dig in with a popular example, getter [[get]] and setter [[set]]. which allows us to intercept get & set operations with custom behavior.
let targetObj = {a:1, b:2, c:3},
    handler = {
        get: (target, key, context) => {
            return target[key] + ' from Proxy';
        },
        set: (target, key, value) => {
            console.log("setting " + value + " @" + key + " By Proxy set handler");
            target[key] = value;
        }        
    },
    proxyObj = new Proxy(targetObj, handler);

    // Accessing targetObj Properties
    targetObj.a // will return '1'
    targetObj.b // will return '2'

    /** NOTE: by accessing targetObj will not return the postfix text we added, 
    *   since we're acessing the non-proxied object. however by accessing
    *   the proxyObj the o/p will be different as shown below 
    */

    proxyObj.a // will return `1 from Proxy`
    proxyObj.d = 4 // will console `setting 4 @d By Proxy set handler`

By the above example,

The proxy handlers (get & set) each intercept the operation when a respective meta-programming task is performed on the targetObj.
The new Proxy() invoke constructor of type intrinsic object %FunctionPrototype% meaning, proxy is an exotic objects which do not have a [[Prototype]] internal slot that requires initialization.
Being said that proxy do not have prototype chain, proxyObj do have below intrinsic object, 
[[Handler]]    -> Handler obj -> has get & set trap function.
[[Target]]       -> targetObj -> has a,b,c properties.
[[IsRevoked]  -> By debaut false.



Proxy's Internal Method's and Internal Handler's
As we know every proxy object is an exotic object whose essential internal methods are partially implemented using ECMAScript. Every proxy objects has an internal slot called [[ProxyHandler]] aka trap / handler hook function callbacks. The value of [[ProxyHandler]] is an object, called the proxy’s handler object or null by default. Every proxy object also has an internal slot called [[ProxyTarget]] whose value is either an object or null value. This object is called the proxy’s target object as in our case it's targetObj as per above example.
The below table [Proxy Handler Methods] shows the internal method's and it's respective Handler Method's where some of them will be implemented in upcoming examples,



Internal Method
Handler Method




[[GetPrototypeOf]]
getPrototypeOf


[[SetPrototypeOf]]
setPrototypeOf


[[IsExtensible]]
isExtensible


[[PreventExtensions]]
getOwnPropertyDescriptor


[[HasProperty]]
has


[[Get]]
get


[[Set]]
set


[[Delete]]
deleteProperty


[[OwnPropertyKeys]]
ownKeys


[[Call]]
apply


[[Construct]]
construct


[[DefineOwnProperty]]
defineProperty


[[Enumerate]]
enumerate


[[GetOwnProperty]]
getOwnPropertyDescriptor



Creating a Revocable Proxies
Besides creating common Proxies, we can also create temporary revocable proxies, which can be dismantle any time we want. To create a revocable Proxy, we need to use Proxy.revocable(target, handler) (instead of new Proxy(target, handler)), and instead of returning the Proxy directly, it’ll return an Object that would looks like { proxy, revoke() }, An Example,
let targetObj = {a:1, b:2, c:3},
    handler = {
        get: (target, key, context) => {
            return target[key] + ' from Proxy';
        },
        set: (target, key, value) => {
            console.log("setting " + value + " @" + key + " By Proxy set handler");
            target[key] = value;
        }        
    },
    {proxy, revoke} = Proxy.revocable(targetObj, handler);

    proxy.a; // console / return '1 from Proxy'

    revoke(); // Revoking or Disabling proxy 

    proxy.a // Uncaught TypeError: Cannot perform 'get' on a proxy that has been revoked at :1:6

Proxies as prototypes 
As we know Proxies don't have a prototype but it doesn't mean it can be used as a prototype,  By extending the above example with targetObj and handler
let obj = Object.create(proxyObj);

obj.a // console "1 from Proxy"

By the above example, we have now extended the object's Prototype using proxy object via Explicit Prototype.
Using Proxies to hide all Properties 
We can use Proxies to make every property in an object completely hidden, except for when getting the value. All ways we can find out if a property exists on an Object in JavaScript:

Reflect.has,Object.hasOwnProperty,Object.prototype.hasOwnProperty, and the in operator all use [[HasProperty]]. Proxy can trap this with has.
Object.keys/Object.getOwnPropertyNames, which uses [[OwnPropertyKeys]]. Proxy can trap this with ownKeys.
Object.entries (an upcoming ES2017 feature), also uses [[OwnPropertyKeys]] - again - trapped by ownKeys.
Object.getOwnPropertyDescriptor which uses [[GetOwnProperty]]. Proxy can trap this with, surprise surprise, getOwnPropertyDescriptor.

that being said, with this kind of implementation, we can totally hide the properties of an Object. An Example
let propertiesToHide = ['a', 'c']; // To hide properties `a` and `c
let targetObj = {a:1, b:2, c:3},
    handler = {
      has(target, property) {
        if (propertiesToHide.indexOf(property) != -1) {
          return false;
        }
        return target[property]; // Best Method use Reflect.has(target, property);
      },
      ownKeys(target) {
        return Object.ownKeys(target).filter( // Best Method use Reflect.ownKeys..
          (property) => propertiesToHide.indexOf(property) == -1
        );
      },
      getOwnPropertyDescriptor(target, property) {
        if (propertiesToHide.indexOf(property) != -1) {
          return undefined;
        }
        return Object.getOwnPropertyDescriptor(target, property);// Best Method use Reflect.getOwnPropertyDe..
      }
    },
    proxyObj = new Proxy(targetObj, handler);

    Object.keys(proxyObj) // console ['b'];
    proxyObj.hasOwnProperty('a') // would return false;
    proxyObj.hasOwnProperty('b') // would return true;
    Object.getOwnPropertyNames(proxyObj) // would return ['b'];

    proxyObj.a; // would return 1;

NOTE: By the above implementation, we can only hide the properties of an Object that it holds, its value is still accessible.
Binggo !!!  some of the use cases for proxies

Tracing property accesses:Consider a naive example, where we wanna trace out all the properties of an Object that are accessed/modified. To demonstrate how that works, let’s create a class and trace accesses to the properties of an instance.
let targetObj = {a:1, b:2, c:3},
 tracePropAccessFn = (target, props) => {  
 let propKeySet = new Set(...props);  
     return new Proxy(target, {  
         get(target, propKey, receiver) {  
             if (propKeySet.has(propKey)) {  
                 console.log('GET '+propKey);  
             }  
             return Reflect.get(target, propKey, receiver); // If not Reflect can use target[propKey]  
         },  
         set(target, propKey, value, receiver) {  
             if (propKeySet.has(propKey)) {  
                 console.log('SET '+propKey+' = '+value);  
             }  
             return Reflect.set(target, propKey, value, receiver);// If not Reflect can use target[propKey]

         },
     });
 },
 proxyObj = tracePropAccessFn(targetObj, Object.keys(targetObj));

 proxyObj.a // would console `GET` a & return value '1'

 proxyObj.a = 100; // would console `SET a = 100` & return '100'


Tackling unknown properties:
An such example would be throwing an exception, If the accessed property doesn’t even exist in the prototype chain of an Object.
let propertyChecker = new Proxy({}, {
         get(target, propKey, receiver) {
            if (!(propKey in target)) {
                throw new ReferenceError('OOPS!!! Unknown property: ' + propKey);
            }
            return Reflect.get(target, propKey, receiver);// If not Reflect can use target[propKey]
        }
    });

    // Create all Object with property checker via explicit prototype.
    let sampleObj = Object.create(propertyChecker);

    // Accessing non property of an object

    sampleObj.a // Uncaught ReferenceError:OOPS!!! Unknown property:


Restricting Access to Properties when needed / for a particular time:
In the fallowing example, we try to restrict the access of a property over the period of time to avoid race condition or to maintain atomicity in the current workflow.

let isLoaded = false, // Initially data is not loaded, hence set to 'false' by default
    data = new Proxy({}, {
                get(target, propKey, receiver) {
                    if (!isLoaded) {
                        throw new TypeError('Revoked'); // return 'false' depending on the use-case
                    }
                    return Reflect.get(target, propKey, receiver);
                },
                has(target, propKey) {
                    if (!isLoaded) {
                        throw new TypeError('Revoked'); // return 'false' depending on the use-case
                    }
                    return Reflect.has(target, propKey);
                }
        });
    data.sampleProp; // Uncaught TypeError: Revoked. 
    data.a // Uncaught TypeError: Revoked. 

    $.ajax.onSuccess(err, res) {
        res['sampleProp'] = "injecting sample prop value for testing"
        data = res; // save ajax response into data Object 
        isLoaded = true; // make Object accessible once data saved for further process         
   }

   data.sampleProp // would print the value
   data.a // return `undefined`




Conclusion 
Proxies, An Ability to modify itself is way cool, but should not be misused as a hack to accomplish certain tasks, a lot more can be accomplished as showed in examples above rather than just using only getter and setter. For instance, it could be used to build certain functionalities into a library or framework, or to make a special kind of objects to be used throughout your application. one such example as we have seen before is Revocable proxies which are useful for when we need to pass our objects to untrusted, third party code thus controlling the property access.

reflections.html.body:
Reflections
An non-construct built-in object that provides methods for interceptable JavaScript operations

Reflections are all about Reflection through introspection - used to discover very low-level information about your code helping with forwarding default operations from the handler to the target. It goes hand in hand with proxies which is all about Reflection through intercession - wrapping Object and intercepting their behavior through traps.
The fallowing are the static functions that Reflection Object provides, It has the same names as the proxy handler methods where some of them are same as corresponding methods on Object.
Reflect.apply ( target, thisArgument, argumentsList )
In ES5, we would typically use the Function.prototype.apply method to call function a function with a given context and arguments provided as Array with the below example
Function.prototype.apply.call(sumFn, null, [1, 2, 3, 4]) === 10;

Which is horrible, However we call also do,
Function.prototype.apply.call(sumFn, null, [1, 2, 3, 4]) === 10;

But, this is still not a cleaner way. With Reflect.apply which is pretty much like Function#apply / Function#call statement
Reflect.apply(sumFn, null, [1,2,3,4]) === 10;

That being said, It is mind blowing! how Reflect.appy is less verbose and most importantly it protect us from the pitfalls of Function#apply / Function#call where any code could trivially change the functionalities of call or apply method leaving us stuck wiht broken code or horrible workarounds.
Reflect.construct (target, argumentsList[, newTarget])
A static method which act like the new operator as a function. It is equivalent to calling new target(...args). This will work with Classes, and sets up the correct object so that Constructors have the right this object with the matching prototype. In ES5 we would use Object.create()instead and pass that to apply or call methods. An Example,
class Auto {
    constructor(model) {
        this.model = model;
    }
    getModelNumber() {
        return "Brand VW: Model: " + this.model;
    }    
}

//ES5 factory  method implementation
let instance = Object.create(Auto.prototype); // creating a factory 
instance.getModelNumber.call({model:"Pollo"}); // would print "Brand VW: Model: Pollo"

//ES6 using Reflect
let instanceByReflect = Reflect.construct(Auto, ["Pollo"]); //creating facory
instanceByReflect.getModelNumber(); // would print "Brand VW: Model: Pollo"

//Applying Reflect to achive sub-classing technique
function someConstructor() {}
var result = Reflect.construct(Array, [], someConstructor);

Reflect.getPrototypeOf(result); // someConstructor.prototype
Array.isArray(result); // true

Thus with the help of Reflect.construct we not only attain subclassing inheritance but also a neat code structure which can easily blunt with modern code practice.
Reflect.defineProperty ( target, propertyKey, attributes )
Reflect.defineProperty() method is like Object.defineProperty() which lets you to define metedata about the property. but returns a Boolean.  NOTE: _Throws a TypeError _is if target is not an Object. An Example,
var obj = {};
Reflect.defineProperty(obj, "x", {value: 7}); // true
obj.x; // 7

Reflect.getOwnPropertyDescriptor ( target, propertyKey )
This, once again, pretty much replaces Object.getOwnPropertyDescriptor, getting the descriptor metadata of a property if it exists on the object, undefined otherwise. An Example,
Reflect.getOwnPropertyDescriptor(obj, "x");
// would return Object {value: 7, writable: false, enumerable: false, configurable: false}

The Reflect.getOwnPropertyDescriptor intern calls the Object.getOwnPropertyDescriptor but the difference is,
// would return Uncaught TypeError: Reflect.getOwnPropertyDescriptor called on non-object
Reflect.getOwnPropertyDescriptor('foo', 'f');

Object.getOwnPropertyDescriptor('foo', 'f'); // would return just 'undefined'

Reflect.has( target, propertyKey )
Reflect.has is an interesting one, because it is essentially the same functionality as the in operator (outside of a loop). Both use the [[HasProperty]] internal method and returns an Boolean indicating whether or not the target has the property. An Example,
Reflect.has({x: 0}, "x"); // true
Reflect.has({x: 0}, "y"); // false

// returns true for properties in the prototype chain 
Reflect.has({x;0}, "toString"); // true

Reflect.get(target, propertyKey[, receiver])
Reflect.get method works like getting a property from an object (target[propertyKey]) as a function. An Example,
// Object
var obj = { a: 1, b: 2 };
Reflect.get(obj, "a"); // 1

// Array
Reflect.get(["zero", "one"], 1); // "one"

Reflect.set(target, propertyKey, value[, receiver])
Reflect.set method works like setting a property on an object. An Example,
// Object
var obj = {};
Reflect.set(obj, "prop", "value"); // true
obj.prop; // "value"

// Array
var arr = ["duck", "duck", "duck"];
Reflect.set(arr, 2, "goose"); // true
arr[2]; // "goose"

Reflect.ownKeys(target)
Reflect.ownKeys method wroks similar like Object.Keys() returns an array of the target object's own property keys. An Example,
Reflect.ownKeys({z: 3, y: 2, x: 1}); // [ "z", "y", "x" ]
Reflect.ownKeys([]); // ["length"]

//Working with Symbols 
let left = Symbol.for("LEFT");
let right = Symbol.for("RIGHT");

let obj = {left: 'left Node', right: 'right node, node: 1};
Reflect.ownKeys(obj); // [Symbol(LEFT), Symbol(RIGHT), "node"]

Reflect.preventExtensions()
The static Reflect.preventExtensions() method prevents new properties from ever being added to an object similar to _Object.preventExtensions() _with an diffrence Reflect.preventExtensions can not be used against non-object value which is not the case with Object.preventExtensions. An Example,
var Obj = {x:1};
Reflect.isExtensible(Obj); // === true

// ...but that can be changed.
Reflect.preventExtensions(Obj);
Reflect.isExtensible(Obj); // === false

Obj.y = 1;
console.log(Obj); // would print {x:1}

// The difference
Reflect.preventExtensions(1);// TypeError: 1 is not an object
Object.preventExtensions(1); // would return 1

Reflect.getPrototypeOf ( target )
Again, The Static method Reflect.getPrototypeOf() _is same as _Object.getPrototypeOf(). It returns the prototype (i.e. the value of the internal [[Prototype]] property) of the specified object. An Example,
Reflect.getPrototypeOf({}); // Object.prototype

class Auto {}

Reflect.getPrototypeOf(new Auto()) == Auto.prototype; // True

Reflect.setPrototypeOf ( target, proto )
Of course, we wouldn’t have getPrototypeOf without setPrototypeOf. Reflect.setPrototypeOf is much more basic - if it receives a non-object it’ll throw a TypeError, but other than that, It sets the prototype (i.e., the internal [[Prototype]] property) of a specified object to another object or to null and return the result of [[SetPrototypeOf]] - which is a Boolean indicating if operation was successful. An Example,
// consider the Auto example,
class Auto {...}
let instance = new Auto("Pollo");

Reflect.setPrototypeOf(instance, Array.prototype); // Applying Array.prototype to Auto Instance

// It can change an object's [[Prototype]] to null.
Reflect.setPrototypeOf({}, null); // true

// Returns false if target is not extensible.
Reflect.setPrototypeOf(Object.freeze({}), null); // false

//The Diffrence
Object.setPrototypeOf(1); // Uncaught TypeError: Object prototype may only be an Object or null: undefined
Reflect.setPrototypeOf(1); //VM1841:1 Uncaught TypeError: Reflect.setPrototypeOf called on non-object

Just Making things clear !!!

Reflect is not a functional Object
Reflect doesn't have a [[Construct]] internal method
It is not possible to use the Reflect Object with the new  Operatior
Reflect Object doesn't have a [[Call]] internal method
It is not possible to invoke Reflect Object as a functional method

Conclusion
Meta Programming an ability to examine, introspect, and modify its own structure and behavior at runtime. Thus JavaScript being a dynamic language, the Proxies and Reflection gives the flexibility to achieve what is needed and its Obvious that we have barely scratched the surface of MP the best is yet to come. Long live JavaScript !!!
